import React, { Component } from 'react';
import logo from './logo.svg';
import './App.css';

class App extends Component {
  render() {
    return (
      <div className="App">

        <table style={{
          backgroundColor: '#000',
          display: 'block',
          color: '#fff',
          fontSize: 24
        }}>
          <tbody>
            <tr>
              <td>
                <img width="50" src="green_app_icon.svg"/>
              </td>
              <td>
                <h3></h3>MoviesDB Search
              </td>
            </tr>
          </tbody>
        </table>

      </div>
    );
  }
}

export default App;
